<p> </p>

<p>Tout d''abord comme la dit "Thomas Esteve" disposer d''<strong>un onglet</strong>:</p>

<p>-<strong>agenda/calendex/futur-log</strong> (où il y aurait des données tels que les réunions du CDJ(avec le lieu), les lieux de rendez vous par rapport à des projets ou sorties culturelles,..etc), </p>

<p>-<strong>contact</strong> -&gt;une adresse et un mail (pour demander des informations ou communiquer avec la "direction"), </p>

<p>-<strong>discution libre</strong> pour tout membres du CDJ pour communiquer entre nous, ou là où nous créerions un sujet A dans lequel on parlerais de transformer une idée "A" en projet "A",..</p>

<p> </p>

<p>L''onglet<strong> idées</strong> et également <strong>projets</strong>, je trouve qu''il manque dans chacun des deux onglets, un texte explicatif, indiquant les domaines dans lesquel nous pouvons ouvrir des sujets. <em>Exemple pour idées: Ici vous pouvez nous aidez à améliorer le site et/ou donnez vos idées de contenus (textes, photos, onglets). Vous avez aussi la possibilité de donner des idées qui pourront peut être donner forme à des projets (dans le domaine de l''environnement ou du scolaire par exemple).</em></p>

<p> </p>

<p>Pour les <strong>idées</strong>, après que le soutiens soit plus positif que négatif (d''ailleurs apartir de combien d''avis l''idée peut elle être entendu), il faudrait que l''admin, si possible, indique si la modification/l''idée est faisable sur le site et quand il la fera. </p>

<p> </p>

<p>Pour la partie "<strong>mon compte</strong>", se serait sympas d''avoir une page de profil, où l''on peut se décrire brièvement (le rendre public ou non), ou mettre des photos de son secteur par exemple.</p>

<p> </p>

<p>Voilà je pense que pour l''instant c''est tout x).</p>

<p>Bonne journée et merci d''avoir eu le courage de lire.</p>
