<p>Le conseil départemental de l''Aude a lancé des travaux pour aménager une voie verte reliant le canal du midi (Bram) à Moulin-Neuf et Sainte-Colombe sur l''Hers. </p>

<p>Sauf erreur de ma part, des mesures de rénovation ont déjà été entreprises aux alentours de Chalabre. </p>

<p>J''ai pensé que le conseil départemental des jeunes de l''Aude pourrait mener une action de valorisation et de promotion de cette voie verte, et plus largement du patrimoine local. En effet, cette voie verte relie des sites classés et permettra en toute sécurité de découvrir les paysages de notre département. Enfin, cette future voie verte est assez inconnue du public de moins de 25 ans, qui lui-même peut être à la recherche de randonnées pédestres ou cyclistes.</p>

<p> </p>

<p>Par exemple, nous pourrions pour faire découvrir une portion de cette voie verte aux jeunes en organisant une sorte de course d''orientation améliorée voire de se rapprocher d''un phénomène à la mode : l''escape game.</p>

<p>En mélant course d''orientation et énigmes, ce pourrait être un événement convivial et ludique. Les jeunes participants à cette journée pourraient réagir sur les divers réseaux sociaux (avec un hastag ...). Nous pourrions, en fin de la journée, recueillir des témoignages pour un éventuel clip vidéo mettant en avant des jeunes et attirer ce public sur la voie verte (à l''instar de la vidéo de lancement du CDJ).</p>

<p>Personnellement, les buts principaux d''une telle action seraient : </p>

<ul>
	<li>Découvrir le patrimoine local et le valoriser</li>
	<li>Promouvoir la voie verte auprès du public jeune, mais pas uniquement</li>
	<li>Mener une action conviviale à destination des jeunes</li>
</ul>

<p> </p>

<p><strong>Qu''en pensez-vous ? </strong></p>

<p> </p>
