<p>Vous avez été nombreux à venir Samedi 3 février 2018 :) <strong>Merci à vous !</strong></p>

<p>Pour ceux qui n''ont pu être présents,  la journée a permis, par le biais d''ateliers animés, de dégager de nombreuses idées qui sont publiées dans l<strong>''onglet idées</strong> de la plateforme. <strong>Allez y, commentez, likez, exprimez-vous !!!</strong></p>

<p>Le Comité d''animation a été élu ! Bravo à Maxime, Alexia, Antoine, Cassandra, Hugo, Emmanuelle, Florian, Chloé, Thomas, Marie-Lou, Raphael, Jade, Pauline, Amandine, Jules et Danaé :)</p>

<p>Bientôt, le 10 mars 2018,<strong> Comité d''animation</strong> se réunira pour sa<strong> première réunion</strong>, alors, <strong>n''attendez pas</strong>, pour voir remonter vos idées en futurs Projets ...  <strong>Cliquez sur Idées puis commentez, likez et exprimez-vous !!! </strong></p>

<p>C''est<strong> VOUS </strong>les acteurs de cette aventure...</p>

<p>A très bientôt !</p>

<p>L''équipe du CDJ</p>

