INSERT INTO public.debates (id, title, description, author_id, created_at, updated_at, visit_id, hidden_at, flags_count, cached_votes_total, cached_votes_up, cached_votes_down, ignored_flag_at, comments_count, confirmed_hide_at, cached_anonymous_votes_total, cached_votes_score, hot_score, confidence_score, geozone_id, tsv, featured_at) VALUES (16, 'Bourse (au mérite?)', '<p>Il y a beaucoup de jeunes étudiants, ou leurs familles, qui sont dans l''incapacitée de payer certaines choses (dont principalement la cantine.) Afin d''alléger les factures de ces familles, une bourse au mérite peux être mis en place pour les familles en diffcultées, avec un jeune motivé pour ces études, en commencant par l''obtention d''un brevet avec mention (à débattre là dessus ?), puis dans la poursuite d''étude avec un bac (ou équivalence) avec mention ( à débattre aussi là dessus?) tout en ayant la certitude que l''étudiant va en cours pour étudier et non juste pour percevoir la bourse (ouais ouais ils sont ingénieux ces petits). De manière a établir ce système financier en plus, basé sur des critères sociaux, cela peut éviter à un étudiant d''avoir un emploi en parallèle de ces études, sachant que c''est la première cause d''echec dans les études superieures. </p>
