INSERT INTO public.debates (id, title, description, author_id, created_at, updated_at, visit_id, hidden_at, flags_count, cached_votes_total, cached_votes_up, cached_votes_down, ignored_flag_at, comments_count, confirmed_hide_at, cached_anonymous_votes_total, cached_votes_score, hot_score, confidence_score, geozone_id, tsv, featured_at) VALUES (15, 'Sensibilisation/actions écologiques', '<p>On est tous concernés par l''environnement, notament nous les jeunes. Il faut arreter de vouloir sensibiliser par le biai d''affiches et/ou de pub et passer à l''action. De simples changements peuvent commencer a ce faire dans les lieux publics, établissement scolaires, locaux associatifs etc.. Ces changements sont des petites habitudes à prendre mais peuvent être benefiques. Le tri sélectif : différentes poubelles, différentes couleurs, simple rapide efficace. Limiter le gaspillage: notament dans les cantines des établissements scolaires. Recylage de bouchons: très utile pour les fauteils handicapés et simple à faire.</p>
INSERT INTO public.debates (id, title, description, author_id, created_at, updated_at, visit_id, hidden_at, flags_count, cached_votes_total, cached_votes_up, cached_votes_down, ignored_flag_at, comments_count, confirmed_hide_at, cached_anonymous_votes_total, cached_votes_score, hot_score, confidence_score, geozone_id, tsv, featured_at) VALUES (14, 'Accès a la culture pour tous', '<p>Afin d''être égaux, il faut pourvoir acceder à la même écudation, peut-importe le milieu social, ou la localisation géographique du département. Pour parvenir a nos fin, on pourrait developper un financement pour creer une ''carte forfait'' pour que chaque jeune ai des droits de visites pour les musées présents dans le département a pris réduit. L''entrée serait réduite au maximun grâce a des partenaires, et le jeune n''aurait qu''a payer 1 à 5€ maximun pour ce cultiver. </p>
